import React from 'react';
import Question from "./Question"


const Questions = (props) => {
    const questions = props.questions;

    const questionTest = questions.map((q => {
        return (
            <Question questions={q} />
        )
    }))

    return (
        <div className="root">
            {questionTest}
        </div>
    )
}

export default Questions;
